element.documentation:
Команда удаления устройства у партнёра.

Тело сообщения:
{
	PartnerId : string (not null, not empty) - идентификатор партнёра.
	DeviceId : string (not null, not empty) - идентификатор устройства.
}

Тело ответа:
{
	Result : string (not null, not empty, success | failure | device_not_found | partner_not_found | sensor_is_bound) - где sensor_is_bound ошибка в случае если один из сенсоров устройства привязан к схеме размещения.
}

Команда редактирования устройства партнёра.

Тело сообщения:
{
    PartnerId : string (not null, not empty) - идентификатор партнёра (владельца устройства). Не может быть изменено.
	DeviceId : string (not null, not empty) - идентификатор устройства. Не может быть изменено.
	ConnectionString : Option (nullable) - если указано, то новая строка подключения к устройствам (например, URI или IP адрес).
	Login : Option (nullable) - если указано, то новый логин для входа на устройства.
	Password : Option (nullable) - если указано, то новый пароль для входа на устройства.
	SerialNumber : string (nullable, not empty) - если указано, то новый серийный номер устройства.
	Sensors : [ Sensor ] (nullable) - если указано, то новый список датчиков устройства.
	Description : Option (nullable) - если указано, то новый комментарии партнёра об устройстве.
}
где Option это 
{
	Value : string (nullable) - новое значение поля.
}

где Sensor это:
{
	Id : string (not null, not empty) - идентификатор датчика устройства.
	MetricType : string (not null, not empty, people-count | sales-flow) - тип метрики, которую собирает датчик.
}

Тело ответа:
{
	Result : string (not null, not empty, success | failure | device_not_found | partner_not_found | duplicate_sensor_id | sensor_is_bound | duplicate_device_id) - где  duplicate_sensor_id это ошибка дублирования идентификаторов датчиков.
}

Команда регистрации устройства партнёра в журнале.
Тело сообщения: { PartnerId : string (not null, not empty) - идентификатор партнёра (владельца устройства). DeviceType : string (not null, not empty, countmax) - тип устройства. ConnectionString : string (nullable, not empty) - строка подключения к устройствам (например, URI или IP адрес). Login : string (nullable, not empty) - логин для входа на устройства. Password : string (nullable, not empty) - пароль для входа на устройства. Sensors : [ Sensor ] (not null) - список датчиков устройства. SerialNumber : string (not null, not empty) - серийный номер устройства. Description : string (not null) - комментарии партнёра об устройстве. } где Sensor это: { Id : string (not null, not empty) - идентификатор датчика устройства. MetricType : string (not null, not empty, people-count | sales-flow) - тип метрики, которую собирает датчик. }
Тело ответа: { Result : string (not null, not empty, success | failure | duplicate_device_id | duplicate_sensor_id) - где duplicate_device_id это ошибка дублирования идентификаторов устройств для партёнра, duplicate_sensor_id это ошибка дублирования идентификаторов датчиков. DeviceId : string (nullable, not empty) - идентификатор созданного устройства, в случае успеха или null. }

Команда привязки датчиков к схеме размещения.

Тело сообщения:
{
	LayoutId : string (not null, not empty) - идентфикатор схемы размещения, к которой выполняется привязка.
	SensorIds : [ string ] (not null, not empty) - идентификаторы датчиков, которые необходимо привязать к схеме размещения.
}

Тело ответа:
{
	Result : string (not null, not empty, success | failure | sensor_invalid ) - где sensor_has_bound_already означает, что датчик уже привязан к другой схеме размещения.
	InvalidSensorIds : [ string ] (not null) - в случае ошибки список идентификаторов датчиков, по которым возникла ошибка.
}

Команда отвязки датчиков от схемы размещения.

Тело сообщения:
{
	LayoutId : string (not null, not empty) - идентфикатор схемы размещения, для которой выполняется отвязка.
	SensorIds : [ string ] (not null, not empty) - идентификаторы датчиков, которые необходимо отвязать от схемы размещения.
}

Тело ответа:
{
	Result : string (not null, not empty, success | failure | sensor_invalid ).
	InvalidSensorIds : [ string ] (not null) - в случае ошибки список идентификаторов датчиков, по котороым возникла ошибка.
}

Получение прав пользователя.

Тело запроса:
{
	UserIds : [ string ] (nullable) - если указано, то идентификаторы пользоватлей, для которых запрашивают роли, иначе все пользователи.
}

Тело ответа:
{
	Result : string (not null, not empty, success | failure) - результат выполнения запроса.
	Users : [ User ] (not null) - список пользователей и их ролей.
}
где User это:
{
	Id : string (not null, not empty) - идентификатор пользователя.
	Roles : [ string ] (not null) - список ролей пользователя.
}

