Команда запроса на смену учетных данных пользователя.

Тело запроса:
{
	UserId : string (not null, not empty) - идентфикатор пользователя, для которого выполняется смена учетных данных.
	Password : string (not null, not empty) - новый пароль пользователя.
	PublicToken : string (not null, not empty) - публичный токен пользователя.
}
Тело ответа:
{
	Result : string (not null, not empty, success | failure) - результат смены пароля.
}

Команда проверки доступа пользователя на основе атрибутов.

Тело запроса:
{
	UserId : string (not null, not empty) - идентификатор пользователя.
	RulesetId : string (not null, not empty) - идентификатор набора правил.
	Attributes : Dictionary<string, [ string ]> (not null) - набор параметров для набора правил. Ключ имя параметра, значение - массив значений параметра.	
}

Тело ответа:
{
	Result : string (not null, not empty, success | failure) - результат выполнения команды.
	Action : string (nullable, not empty, permit | deny | not_applicable | indeterminate) - результат применения набора правил. Где permit - доступ разрешён, deny - доступ запрещён, not_applicable - правило не применимо, indeterminate - правило применилось с ошибкой.
}

