}

Тело ответа:
{
	Result : string (not null, not empty, success | failure) - результат выполнения аннулирования.
}

Команда проверки подлинности пользователя.

Тело запроса:
{
	Login : string (not null, not empty) - логин пользователя (совпадает с электронной почтой).
	Password : string (not null, not empty) - пароль пользователя.
}

Тело ответа:
{
	CheckResult : bool (not null) - результат проверки. Если true - проверка пройдена успешно.
	Result : string (nullable, not empty, success | failure) - результат выполнения операции проверки.
	UserId : string (nullable, not empty) - идентификатор пользователя.
	Enabled : bool (nullable) - Если true, то учётная запись доступна.
}

Генерация нового публичного токена.

Тело запроса:
{
	UserId : string (not null, not empty) - идентификатор пользователя
	Policies : [ Policy ]
}
где Policy : Dictionary<string, string> - это набор пар ключ значение

Тело ответа:
{
	Result : string (not null, not empty, success | failure) - результат генерации публичного токена.
	Token : string (nullable, not empty) - если установлен, то сгенерированный токен.
	ValidateTo : DateTime (nullable, not empty) - если установлено, то время, до которого валиден токен.
}

