Тело команды:
{
	UserId : string (not null, not empty) - идентификатор пользователя.
	Roles : [ string ] (not null)  - новый список ролей пользователя.
}

Тело ответа:
{
	Result : string (not null, not empty, success | failure | user_not_found) - результат выполнения команды.
}

Команда получения отчёта по метрикам.

Тело сообщения:
{
	ExportId : string (not null, not empty) - идентификатор шаблона экспорта.
	From : DateTime (not null, not empty) - время, с которого необходимо экспортировать данные.
	To : DateTime (not null, not empty) - время, с которого необходимо экспортировать данные.
	EntityType : string (not null, not empty, perimeter | zone | floor | room | tentant | passage | shop | category | anchor | price-segment | entity | cluster | brand | slot1 | slot2 | region | bush | format | slot3 | slot4) - тип агрегируемой сущности.
	LayoutId : string (not null, not empty) - идентификатор схемы размещения.
    Time: TimeSample (not null) - интервал группировки по времени.
}
где TimeSample это
{
	Unit : string (not null, not empty, second | minute | hour | day | week) - единица группировки по времени.
	Amount : long (not null) - количество единиц в одной группе.
}

Тело ответа:
{
	Result : string (not null, not empty, success | failure) - результат выполнения запроса.
    DataPoints: [ DataPoint ] (not null) - результат обработки запроса.
}
где DataPoint это:
{
	Index : Index (not null) - классификационный индекс пара ключ-значение, где ключ имя тега, а значение - значение тега.
    DateTime: DateTime (not null) - время точки.
    Values: Values (not null) - пара ключ-значение, где ключ - имя получаемого значения, а значение - получаемое значение.
}

