}

Команда обновления пользователя.

Тело команды:
{
	UserId : string (not null, not empty) - идентификатор пользователя.
	Enabled : bool (nullable) - если установлено, то: если false, то пользователь заблокирован.
	Occupation : Option (nullable) - если указано, то функциональная область пользователя, его занятость.
}
где Option
