Команда получения списка пользователей.

Тело запроса:
{
	UserIds : [ string ] (not null) - если указано, то идентификаторы запрашиваемых пользователей.
}

Тело ответа:
{
	Result : string (not null, not empty, success | failure) - результат выполнения команды.
	Users : [ User ] (not null) - список пользователей из реестра.
}
где User это:
{
	Id : string (not null, not empty) - идентификатор пользователя.
	Email : string (not null, not empty) - адрес электронной почты пользователя.
	Enabled : bool (not null) - если false, то пользователь заблокирован.
	Occupation : string (nullable) - занятость пользователя. Например, маркетолог, лизинг-менеджер.
}

Команда получения статуса задачи.

Тело запроса:
{
	Id: string (not null, not empty) - идентификатор запроса.
}

Тело ответа:
{
 Result: string (not null, not empty, success | failure | query_not_found) - результат выполнения команды.
    DataPoints : [ Data ] (not null) - результаты выполнения запросов в виде временного ряда или группы временных рядов.
}
где Data это:
{
    DateTime: DateTime (not null) - время точки.
    Values: Values (not null) - пара ключ-значение, где ключ - имя получаемого значения, а значение - получаемое значение.
}

Команда получения статуса задачи.

Тело запроса:
{
	Id: string (not null, not empty) - идентификатор задачи.
}

Тело ответа:
{
	Result: string (not null, not empty, success | failure | task_not_found | task_failed) - результат выполнения команды.
	QueryId: string (nullable, not empty) - идентификатор запроса.
	Eta: TimeSpan (nullable, not empty) - время, через которое надо еще раз обратиться за статусом.
}
Либо QueryId либо Eta должны быть обязательно установлены, если Result равен success, но не оба сразу.

Команда создания задачи обработки запроса поиска точек метрики.

Тело запроса:
{
    Queries: [ Query ] (not null, not empty) - запросы.
    Sample: Sampling (not null) - дискретизация по времени.
    GroupBy: [ string ] (not null) - список типов сущностей, для группировки данных запросов, применяется для каждого запроса в отдельности.
    Filter: [ GlobalFilter ] (not null) - список фильтров применяемых ко всем запросам.
    Apply: [ Application ] (not null, not empty) - список функций применяемых к результатам запросов.
    OrderBy: [ Order ]  (not null, not empty) - список сортировок результата.
	LayoutId: string (not null, not empty) - идентификатор схемы размещения, для которой выполняется запрос.
}
где Query это
{
    As: string (not null, not empty) - идентификатор результата запроса.
    Select: Select (not null) - параметры запроса.
}

где Select это
{
    From: string (not null, not empty, in) - идентификатор запрашиваемого значения.
    Filter: [ FilterEntity ] (not null) - список фильтров сущностей (воспринимается как операция И).
    Time: Time (not null) - время в рамках которого выбирается значения.
    Offset: long (not null, >= 0) - сколько результирующих записей необходимо пропустить, прежде чем формировать выборку.
    Limit: long (nullable, < config) - количество результирующих записей, которые попадут в выборку
	Aggregate :  string (nullable, count | median | mean | sum | max | min) - если установлено, то функция агрегации данных внутри каждого элемента дискретизации по времени.
}
где FilterEntity это
{
    Type: string (not null, not empty) - тип сущности.
    Ids: [ string ] (not null, not empty) - идентификаторы сущности (воспринимается как операция ИЛИ).
}
где Time это
{
    From: DateTime (nullable) - время начала интервала, если null - тогда нет ограничения интервала снизу.
    To: DateTime (nullable) - время конца интервала, если null - тогда нет ограничения интервала сверху.
}
где Sampling это
{
    Unit: string (not null, not empty, second | minute | hour | day | day_of_week | day_of_year | week | week_of_month | week_of_year | month | month_of_year | quarter | quarter_of_year | year) - единица дискретизации по времени.
    Amount: long (not null) - количество единиц в одном дискретном значении.
}
где GlobalFilter это
{
    LikeForLike: [ string ] (nullable, not empty) - если установлен, то список типов сущностей, для которых нужно выполнять фильтрацию Like-For-Like.
}
где Application это
{
    Function: string (not null, not empty) - имя вызываемой функции.
    Inputs: [ string ] (not null) - список имён запросов, для которых вызывается данная функция.
    As: [ string ] (not null, not empty) - имя результата.
}
где Order это
{
    For: string (not null, not empty) - имя результата для которого выполняется сортировка или специальное значение time.
    Desc: bool (not null) - сортировка по убованию или нет.
}

Например,
{
    "Queries":
    [
	{
	    "As": "a",
	    "Query":
	    {
		"From": "in",
		"Filter":  [ ],
		"Offset": 0,
		"Time":
		{
		    "From": "10 sept 2015",
		    "To": "11 sept 2016"
		}
	    }
	},
	{
	    "As": "b",
	    "Query":
	    {
		"From": "in",
		"Filter": [ ],
		"Offset": 0,
		"Time":
		{
		    "From": "10 sept 2017",
		    "To": "11 sept 2018"
		}
	    }
	}
    ]
    "Sample":
    {
	"Amount": 4,
	"Unit": "year"
    },
    "GroupBy":
    [
	"category",
	"price-segment"
    ],
    "Filter":
    {
	"LikeForLike":
	[
	    "tenant"
	]
    },
    "Apply":
    [
	{
	    "Function": "Id",
	    "Inputs": [ "a" ],
	    "As": "in"
	}
    ],
    "OrderBy":
    [
        {
	    "For": "time",
	    "Desc": true
	}
    ]
}

Тело ответа:
{
	Result: string (not null, not empty, success | failure) - результат выполнения операции.
    TaskId: string (nullable, not empty) - если Result равен success, тогда содержит идентификатор задачи.
}

Команда на пакетную загрузку данных измерений.

Тело запроса:
{
	Measurements : [ Measurement ] 
}
где Measurement это:
{
	SourceId : string (not null, not empty) - идентификатор источника измерений.
	Time : DateTime (not null, not empty) - время выполнения измерения.
	Type : string (not null, not empty) - тип измерений.
	Values : Dictionary <string, string> (not null) - значения измерений, где ключ это имя измерения, а значение - это значение измерения.
}
Тело ответа:
{
	Result : string (not null, not empty, success | failure)  - (success - данные приняты, failure - ошибка при получении данных).
}

Команда выполнения запроса поиска метрик.

Тело сообщения:
{
    Subquery: Query (nullable) - если установлено, то подзапрос, над результатом которого выполняется текущий запрос.
    Select: [ Select ] (not null, not empty) - запрашиваемые элементы.
    MetricType: string (nullable, not empty) - если установлено, то тип запрашиваемой метрики.
    Filter: ExprFilter (not null) - условия фильтрации данных.
    MetricIndex: [ Index ] (not null) - классификаторы запрашиваемых точек метрики.
    Limit: long (nullable) - если установлено, то количество запрашиваемых точек метрики.
    Offset: long (nullable) - если установлено, то сколько надо пропустить точек перед выводом результата.
	Time:  TimeFilter (not null) - признак фильтрации по времени.
    AscendingTimeOrder : bool (not null) - направление сортировки по времени.
}
обязательно должно быть установлено либо поле MetricType, либо поле Subquery.
где Select это пара ключ значение, где ключом может быть field | sum count | median | mean | sum | max | min, а значением не пустой массив запрашиваемых полей в виде строк.
где ExprFilter это
{
    ExprType : string (not null, not empty, or | and) - тип логического выражения
	Expressions : [ Filter, ExprFilter ] (nullable, not empty) - список выражений фильтрации или условие фильтрации.
}
где Filter это пара ключ значение, где ключом может быть eq, nq, gt, gte, lt, lte, а значением объект:
{
    Left: string (not null, not empty) - левая часть выражения.
    Right: string (not null, not empty) - правая часть выражения.
}
где Index это:
{
    Tag: string (nullable, not empty) - если указан, то классификатор точки метрики.
    Time: TimeSample (nullable) - если указан, то интервал группировки по времени.
}
обязательно должно быть установлено либо поле Tag, либо поле Time.
где TimeSample это
{
	Unit : string (not null, not empty, second | minute | hour | day | week) - единица группировки по времени.
	Amount : long (not null) - количество единиц в одной группе.
}
где TimeFilter это
{
