Команда фиксации изменений схемы размещения.

Тело запроса:
{
    LayoutId : string (not null, not emtpy) - идентификатор схемы размещения, к которой применяются изменения.
    Changes : [ Change ] (not null, not empty) - список изменений применяемых к схеме размещения.
}
где Change это:
{
    Notes : string (not null) - заметки по схеме размещения.
    Type : string (not null, not empty, insert | update | remove) - тип изменения: добавление, обновление, удаление.
    Interval : Interval (not null) - временной интервал, который затрагивает изменение.
    Entity : (nullable) - изменяемая сущность или null.
    Relation : (nullable) - изменяемое отношение или null.
    Properties : Properties (nullable) - изменяемые свойства схемы размещения.
    SourceTypes : SourceType (nullable, not empty) - набор пар ключ-значение, где ключ имя метрики, а значение тип сущности, которая является источником для этой метрики, например { "people-count":"sensor", "sales-flow":"renter" }

}
должно быть только одно поле не null из Entity, Relation, Properties, SourceTypes.
для SourceType, Properties может быть установлен только insert | update.
где Interval это:
{
    Start : DateTime (nullable) - время начала изменения, если null - значит изменение действует с времени начала активности схемы размещения.
    End : DateTime (nullable) - время конца изменения, если null - значит изменение действует до текущего момента.
}
где Entity это
{
    Id : string (not null, not empty) - идентификатор сущности (уникальный в рамках схемы)
    Type : string (not null, not empty) - тип сущности, например device, passage
    Parameters : Parameters (not null) - набор опциональных свойств сущности в виде пар ключ значение, где ключ - имя свойства, а значение - значение свойства. Например { "name" : { "ru" : "северный проход" } }.
}
где Relation это
{
    Id : string (not null, not empty) - идентификатор отношения сущностей (уникальный в рамках схемы)
    Type : string (not null, not empty) - тип отношения сущностей, например, consists-of (читать стоит так: Source consists of Target)
    MetricType : string (nullable, not empty) - тип метрики для которой применяется это отношение
    Source : string (not null, not empty) - идентификатор сущности источника.
    Target : string (not null, not empty) - идентификатор сущности приемника.
    Parameters : Parameters (not null, not empty) - набор опциональных свойств отношения сущностей в виде пар ключ значение, где ключ - имя свойства, а значение - значение свойства. Например { "Reverse" : false  }.
}
где Properties это
{
    Languages : [ string ] (not null, not empty) - IETF language tag, например "ru", "en".
    Title : Title (not null, not empty) - набор пар key-value, key - IETF language tag, value - название проекта на этом языке, например { "ru" : "Авиапарк", "en" : "Aviapark" }
    WorkTime : [ WorkTime ]
    TimeZone : string (not null, not empty) - часовой пояс в формате UTC offset (например, "+03")
	FloorSpace : long (not null) - суммарная площадь торгового объекта представленного текущей схемой размещения.
}
где WorkTime это
{
    DayOfWeek : long (not null) - номер дня недели.
    Begin : TimeSpan (not null) - смещение относительно начала суток, время начала работы.
    End : TimeSpan (not null) - смещение относительно начала суток, время конца работы.
}


Тело ответа:
{
    Result : string (not null, not empty, success | failure | validation_error | already_changing_conflict | layout_not_found ) - результат выполнения операции success - успех, failure - сбой выполнения, validation_error - некорректный формат запроса, already_changing_conflict - схема размещения уже редактируется, layout_not_found - схема не найдена.
}

