где Change это:
{
	Name : string (not null, not empty) - имя изменяемого атрибута.
	Type : string (not null, not empty, add | remove | clear | delete) - тип изменения атрибута, где add - добавить новое значение атрибуту, remove - удалить одно из значений атрибута, clear - удалить все значения атрибута, delete - удалить сам атрибут). Все изменения кроме add идемпотентны.
	Value : string (nullable) - новое значение атрибута. Должно быть установлено для типа изменения add, remove.
}

