Событие о создании задачи запроса данных.

Тело запроса:
{
	TaskId: string (not null, not empty) - идентификатор задачи.
    Queries: [ Query ] (not null, not empty) - запросы.
    Sample: Sampling (not null) - дискретизация по времени.
    GroupBy: [ string ] (not null) - список типов сущностей, для группировки данных запросов, применяется для каждого запроса в отдельности.
    Filter: [ GlobalFilter ] (not null) - список фильтров применяемых ко всем запросам.
    Apply: [ Application ] (not null, not empty) - список функций применяемых к результатам запросов.
    Order: [ Order ]  (not null, not empty) - список сортировок результата.
	LayoutId: string (not null, not empty) - идентификатор схемы размещения, для которой выполняется запрос.
}
где Query это
{
    As: string (not null, not empty) - идентификатор результата запроса.
    Select: Select (not null) - параметры запроса.
}

где Select это
{
    From: string (not null, not empty, in) - идентификатор запрашиваемого значения.
    Filter: [ FilterEntity ] (not null) - список фильтров сущностей (воспринимается как операция И).
    Time: Time (not null) - время в рамках которого выбирается значения.
    Offset: long (not null, >= 0) - сколько результирующих записей необходимо пропустить, прежде чем формировать выборку.
    Limit: long (nullable, < config) - количество результирующих записей, которые попадут в выборку
	Aggregate :  string (nullable, count | median | mean | sum | max | min) - если установлено, то функция агрегации данных внутри каждого элемента дискретизации по времени.

}
где FilterEntity это
{
    Type: string (not null, not empty) - тип сущности.
    Ids: [ string ] (not null) - идентификаторы сущности (воспринимается как операция ИЛИ).
}
где Time это
{
    From: DateTime (nullable) - время начала интервала, если null - тогда нет ограничения интервала снизу.
    To: DateTime (nullable) - время конца интервала, если null - тогда нет ограничения интервала сверху.
}
где Sampling это
{
    Unit: string (not null, not empty, second | minute | hour | day | day_of_week | day_of_year | week | week_of_month | week_of_year | month | month_of_year | quarter | quarter_of_year | year) - единица дискретизации по времени.
    Amount: long (not null) - количество единиц в одном дискретном значении.
}
где GlobalFilter это
{
    LikeForLike: [ string ] (nullable, not empty) - если установлен, то список типов сущностей, для которых нужно выполнять фильтрацию Like-For-Like.
}
где Application это
{
    Function: string (not null, not empty) - имя вызываемой функции.
    Inputs: [ string ] (not null) - список имён запросов, для которых вызывается данная функция.
    As: [ string ] (not null, not empty) - имя результата.
}
где Order это
{
    For: string (not null, not empty) - имя результата для которого выполняется сортировка или специальное значение time.
    Desc: bool (not null) - сортировка по убованию или нет.
}

Например,
{
    "Queries":
    [
	{
	    "As": "a",
	    "Query":
	    {
		"From": "in",
		"Filter":  [ ],
		"Offset": 0,
		"Time":
		{
		    "From": "10 sept 2015",
		    "To": "11 sept 2016"
		}
	    }
	},
	{
	    "As": "b",
	    "Query":
	    {
		"From": "in",
		"Filter": [ ],
		"Offset": 0,
		"Time":
		{
		    "From": "10 sept 2017",
		    "To": "11 sept 2018"
		}
	    }
	}
    ]
    "Sample":
    {
	"Amount": 4,
	"Unit": "year"
    },
    "GroupBy":
    [
	"category",
	"price-segment"
    ],
    "Filter":
    {
	"LikeForLike":
	[
	    "tenant"
	]
    },
    "Apply":
    [
	{
	    "Function": "Id",
	    "Inputs": [ "a" ],
	    "As": "in"
	}
    ],
    "OrderBy":
    [
        {
	    "For": "time",
	    "Desc": true
	}
    ]
}

