{ "Id" : string (not null, not empty) - идентификатор шаблона. "Body" : string (not null, not empty) - тело отправляемого письма. "Subject" : string (not null, not empty) - тема отправляемого письма. "Type" : string (not null, not empty) - тип используемого шаблона письма. }

