Выполняемый запрос.

{
    Id: string (not null, not empty) - идентификатор запроса.
	TaskId: string (not null, not empty) - идентификатор задачи выполнения запроса.
	CreationTime: DateTime (not null) - время создания запроса.
	CompletionTime: DateTime (nullable) - если есть, время завершения запроса.
	Query : QueryBody (not null) -  выполняемый запрос.
    Results: [ Result ] (not null) - результат обработки запроса.
	TaskResult: [ DataPoint ] (not null) - результат выполнения задачи запроса.
}
где QueryBody это
{
    Queries: [ Query ] (not null, not empty) - запросы.
    Sample: Sampling (not null) - дискретизация по времени.
    GroupBy: [ string ] (not null) - список типов сущностей, для группировки данных запросов, применяется для каждого запроса в отдельности.
    Filter: [ GlobalFilter ] (not null) - список фильтров применяемых ко всем запросам.
    Apply: [ Application ] (not null, not empty) - список функций применяемых к результатам запросов.
    OrderBy: [ Order ]  (not null, not empty) - список сортировок результата.
	LayoutId : string (not null, not empty) - идентификатор схемы размещения, для которой выполняется запрос.
}
где Query это
{
	CorrelationId : string (not null, not empty) - корреляционный идентфикатор запрос.
    As: string (not null, not empty) - идентификатор результата запроса.
    Select: Select (not null) - параметры запроса.
}

где Select это
{
    From: string (not null, not empty, in) - идентификатор запрашиваемого значения.
    Filter: [ FilterEntity ] (not null) - список фильтров сущностей (воспринимается как операция И).
    Time: Time (not null) - время в рамках которого выбирается значения.
    Offset: long (not null, >= 0) - сколько результирующих записей необходимо пропустить, прежде чем формировать выборку.
    Limit: long (nullable, < config) - количество результирующих записей, которые попадут в выборку
	Aggregate :  string (nullable, count | median | mean | sum | max | min) - если установлено, то функция агрегации данных внутри каждого элемента дискретизации по времени.
}
где FilterEntity это
{
    Type: string (not null, not empty) - тип сущности.
    Ids: [ string ] - идентификаторы сущности (воспринимается как операция ИЛИ).
}
где Time это
{
    From: DateTime (nullable) - время начала интервала, если null - тогда нет ограничения интервала снизу.
    To: DateTime (nullable) - время конца интервала, если null - тогда нет ограничения интервала сверху.
}
где Sampling это
{
    Unit: string (not null, not empty, second | minute | hour | day | day_of_week | day_of_year | week | week_of_month | week_of_year | month | month_of_year | quarter | quarter_of_year | year) - единица дискретизации по времени.
    Amount: long (not null) - количество единиц в одном дискретном значении.
}
где GlobalFilter это
{
    LikeForLike: [ string ] (nullable, not empty) - если установлен, то список типов сущностей, для которых нужно выполнять фильтрацию Like-For-Like.
}
где Application это
{
    Function: string (not null, not empty) - имя вызываемой функции.
    Inputs: [ string ] (not null) - список имён запросов, для которых вызывается данная функция.
    As: [ string ] (not null, not empty) - имя результата.
}
где Order это
{
    For: string (not null, not empty) - имя результата для которого выполняется сортировка или специальное значение time.
    Desc: bool (not null) - сортировка по убованию или нет.
}


где Result это:
{
	CorrelationId : string (not null, not empty) - идентификатор запроса, для которого получен ответ.
    DataPoints: [ DataPoint ] (not null) - результат обработки запроса.
}
где DataPoint это:
{
	Index : Index (not null) - классификационный индекс пара ключ-значение, где ключ имя тега, а значение - значение тега.
    DateTime: DateTime (not null) - время точки.
    LongValues: Dictionary<string, long?> (not null) - пары ключ-значение, где ключ - имя целочисленного поля, а значение - значение целочисленного поля, тип long?.
	DecimalValues: Dictionary<string, decimal?> (not null) - пары ключ значение, где ключ - имя поля числа с плавающей точкой, а значение - число с плавающей точкой.
	BoolValues: Dictionary<string, bool?> (not null) - пары ключ значение, где ключ - имя булевого поля, а значение - булево значение поля.
	StringValues: Dictionary<string, string?> (not null) - пары ключ значение, где ключ имя стрового поля, а значение - строчное значение поля.
}

Индекс классификационной схемы.
Используется для получения классификационной схемы для метрики.
Существует в единственном экземпляре. Меняется при добавлении или удалении снимка схемы размещения.
Индекс должен обеспечивать сложность поиска классификационной схемы не хуже O(logN).

{ 
	Index : AllIndex (not null) - индекс всех метрик
}
где AllIndex это:
{
    <metric-name> : MetricIndex (not null) - индекс для конкретной метрики
}
где <metric-name> : string (not null, not empty) - имя метрики,
MetricIndex это:
{
    <source-id> : [ SourceIndex ] (not null) - индекс для конкретного источника метрики.
}
где <source-id> : string (not null, not empty) - идентификатор источника метрики
SourceIndex это:
{
    <layout-id> : [ LayoutIndex ] (not null) - индекс для конкретной схемы размещения, отсортированный массив по полю Since
}
где <layout-id> : string (not null, not empty) - идентификатор схемы размещения
LayoutIndex это:
{
    Since : DateTime (not null) - время начиная с которого дествует текущий индекс,
    Schemes : [ SchemeIndex ] (not null, not empty) - индекс схем, для которых
}
где SchemeIndex это:
{
    SchemeId : string (not null, not empty) - идентификатор классификационной схемы.
    SnapshotId : string (not null, not empty) - идентификатор cнимка схемы размещения.
}
Массив Schemes может иметь больше одного элемента в случае, когда источник принадлежит нескольким схемам размещения.
В этом случае для одной входящей метрики должно генерироваться несколько исходящих метрик.

Например,
{
    "people-count" :
    {
	"ac3124b3f" :
	[
	    {
		Since : "10 сент 2017 18:00:00",
		Schemes :
		[
		    {
			SchemeId : "bb213ca55",
			SnapshotId : "fa551de22"
		    },
		    {
			SchemeId : "aba656a55",
			SnapshotId : "afec77c87"
		    }		    
		]		    
	    }

	]
    }
}
Источником метрики могут быть любые терминальные сущности схемы размещения.

Классификационная схема выбирается из индекса в следующем порядке:
1. выбирается объект по имени метрики;
2. выбирается объект по идентификатору источника;
3. выбирается объект из массива, первый элемент с Since меньше, чем время измерения.
4. выбирается все объекты массива.

Получение ролей пользователя с идентификатором {user-id}
http://api-viewer.focus.bi/#/user/GetUserRoles
Правила доступа: Пользователь, использующий ресурс, активен Пользователь, использующий ресурс, имеет роль partner-admin Партнер пользователя, использующего ресурс, соответствует партнеру пользователя, над которым выполняется операция

Атрибуты безопасности пользователя.

{
	UserId : string (not null, not empty) - идентификатор пользователя.
	Attributes : Dictionary<string, [ string ]> (not null) - атрибуты пользователя. Ключ - имя атрибута, значение - список значений атрибута.
}

Атрибуты безопасности партнёра.

{
	PartnerId : string (not null, not empty) - идентификатор партнёра.
	Attributes : Dictionary<string, [ string ]> (not null) - атрибуты партнёра. Ключ - имя атрибута, значение - список значений атрибута.
}

Роли пользователя.

{
