	Roles : [ string ] (not null) - список ролей пользователей.
}

Наборы правил для проверки доступа пользователей на базе атрибутов.

{
    Id : string (not null, not empty) - идентификато набора правил (дружественный к человеку)
	Subsets : [ Subset ] (not null, not empty) - подмножество правил для проверки доступа.
}
где Subsets это:
{
	Id : string (not null, not empty) - идентификатор подмножества правил.
	Priority : long (not null) - приоритет правила.
	Conditions : Condition (not null) - условия срабатывания правила.
	Rules : [ Rule ] (not null, not empty) - список применяемых правил.
}
где Condition это:
{
}
где Rule это:
{
	Id : string (not null, not empty) - идентификатор правила.
	Description : string (not null, not empty) - текстовое описание правила.
	Statement : string (not null, not empty) - проверяемое утверджение записанное в виде предиката, который возвращает true (в случае успеха), либо false (в случае провала).
	OnSuccess : string (not null, not empty, skip | permit | deny) - описание, что делать в случае успеха, где skip - перейти к следующему правилу, permit - разрешить доступ, deny - запретить доступ.
	OnFailure : string (not null, not empty, skip | permit | deny) - описание, что делать в случае провала, где skip - перейти к следующему правилу, permit - разрешить доступ, deny - запретить доступ.
}

Атрибуты безопасности схемы размещения.

{
	PartnerId : string (not null, not empty) - идентификатор схемы размещения.
	Attributes : Dictionary<string, [ string ]> (not null) - атрибуты схемы размещения. Ключ - имя атрибута, значение - список значений атрибута.
}

