item.documentation:
Предусловия: 1) Пользователь авторизован и находится на домашней странице 2) Есть данные по проекту Ритейл
Сценарий воспроизведения: 1) Пользователь выбирает период (даты) 2) Пользователь выбирает тип объекта (магазин, регион, итд) 3) Пользователь выбирает объекты (от 1 до...) 4) Отображается суммарная посещаемость выбранных объектов за выбранный период
Результат: на странице появляется посещаемость, агрегированная по выбранному объекту (объектам) за выбранный период времени Пример: посещаемость магазина 1 за неделю; суммарная посещаемость магазинов 1 и 2 за месяц;
